    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from May through August of 1953. The report
    begins by summarizing the weather conditions, water conditions, and wildfires during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, and predators- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. The public relations section
    discusses Refuge visitors, Refuge participation, and fishing. N-R forms are attached.",nt"owner_org":
